  },
  {
    name: "Doncasu",
    image:
      "https://s3-media3.fl.yelpcdn.com/bphoto/7F9eTTQ_yxaWIRytAu5feA/ls.jpg"
  },
  {
    name: "Kimbap",
    image:
      "http://cdn2.koreanbapsang.com/wp-content/uploads/2012/05/DSC_1238r-e1454170512295.jpg"
  }
];

function App() {
  return (
  <div>
    <h1>
    {
      foodILike.map(
        dish => <Food name={dish.name} picture={dish.image}/>
        )
    }
    </h1>
  </div>
  )
}

export default App;
